import React from 'react';
import './About.css'; 

const About = () => {
  return (
    <div className="about-container">
        <p>Välkommen till Malmö Evenemang. Denna sida är skapad som ett hobbyprojekt under min studietid som systemutvecklare i Java. Sidan hämtar info från Ticketmaster, Tickster, och Billettos APIer. Om du har några frågor angående hemsidan kan du kontakta mig på <a href="mailto:manne.ande@gmail.com">manne.ande@gmail.com</a>.</p>
    </div>
  );
};

export default About;
